import React from 'react'
import {Link} from "react-router-dom";

const Admin = () => {
    return (
        <main>
        <nav className="nav">
            <div className="nav-text">
                <ul className="nav-menu menu-main">
                    <li><Link to="/">LOGOUT</Link></li>
                </ul>
            </div>
        </nav>
        </main>
    )
}

export default Admin
